	router.get("/i/api/i/users/email_available.json", async (req, res) => {
	const params = req.query as unknown as IEmailParams;
		const user = await User.findOne({
			email: params.email,
		});
		if (user)
			return res.status(200).send({
				msg: "Email has already been taken.",
				taken: true,
				valid: false,
			});
